  input: 'TEXT,F3A,,"In response to a letter dated May 14, 2002 from Ms. Jill Sugarman,
    Reports Analyst, concerning missing employer and occupation for individuals who
    contribute in excess to $200.  We have demostrated a ''best effort'' attempt to
    obtain this information.  The steps that this committee has taken are as follows:                                                First,
    when the original solitication is made a request card is enclosed asking for the
    employer and occupation.  This card states the reason for the needed  information
    citing the federal statue.   If the need information is not received then a series
    of telephone calls are made to the contributors as a stand alone effort.  These
    calls are made within 15 days of the contribution.  Finally,  if the series of
    telephone calls are not successful, then a letter is sent to the individual.  This
    letter clearly ask for the missing information without soliciting an additional
    contribution.  Once the requested information is received an amended report will
    be electronically filed in its entirety."'
